import Layout from '../components/Layout'

const Index = () => {
  return (
    <Layout>

      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <h1 className="text-center">This is the home page.</h1>
          </div>
        </div>
      </div>
    </Layout>
  )
}

export default Index;
